import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Route,Switch,Link} from 'react-router-dom';
import * as serviceWorker from './serviceWorker';
import 'normalize.css/normalize.css'
import './styles/styles.scss'

const ExpenseDashboardPage=()=>(
    <div>
        This is from my dashboard component
    </div>
)

const AddExpensePage=()=>(
    <div>
        This is my add expense component
    </div>
)

const EditExpensePage=()=>(
    <div>
        This is my Edit expense component
    </div>
)

const HelpExpensePage=()=>(
    <div>
        This is my Help expense component
    </div>
)

const NotFoundPage=()=>(
    <div>
        404! - <Link to='/'>Go Home</Link>
    </div>
)

const Header=()=>(
    <header>
        <h1>Expensify</h1>
    </header>

)

const routes=(
    <BrowserRouter>
    <Switch>
    <Route exact path='/' component={ExpenseDashboardPage}></Route>
    <Route  path='/create' component={AddExpensePage}></Route>
    <Route  path='/edit' component={EditExpensePage}></Route>
    <Route  path='/help' component={HelpExpensePage}></Route>
    <Route component={NotFoundPage}></Route>
    </Switch>

    </BrowserRouter>
)

ReactDOM.render(routes, document.getElementById('root'));

// ReactDOM.render(<IndecisionApp name="Andrew" age={26} option={['Option 1', 'Option 2', 'Option 3']} />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
